import React from "react";

import {
  HashRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";
import { Security, SecureRoute, ImplicitCallback } from "@okta/okta-react";
import Layout from "./components/layout/Layout";
import AboutTheProgram from "./pages/AboutTheProgram";
import Home from "./pages/Home";
import AboutMe from "./pages/AboutMe";
import TimeTable from "./pages/TimeTable";
import Notes from "./pages/Notes";

import Login from "./components/authentication/Login"

const onAuthRequired = ({ history }) => {
  history.push("/login")
}

const App = () => {
  return (
    <Router>
       <Security issuer='https://dev-513675.okta.com/oauth2/default'
              clientId='0oa4yteffFxkEW6SR4x6'
              redirectUri={window.location.origin + '/implicit/callback'}
              onAuthRequired={onAuthRequired} >
        <Layout>
          <Switch>
            <Route exact path="/" component={Home} />
            <SecureRoute path="/time-table" component={TimeTable} />
            <SecureRoute path="/notes" component={Notes} />
            <Route path="/about-the-program" component={AboutTheProgram} />
            <Route path="/about-the-author" component={AboutMe} />
            <Route path='/login' render={() => <Login baseUrl='https://dev-513675.okta.com' />} />
      <Route path='/implicit/callback' component={ImplicitCallback} />
            <Redirect to="/" />
          </Switch>
        </Layout>
      </Security>
    </Router>
  );
};

export default App;
